// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface IHenNFT {
    struct HenTraits {
        uint8 strength;
        uint8 speed;
        uint8 stamina;
        uint8 intelligence;
        uint8 luck;
        uint8 generation;
        uint48 birthTime;
        uint48 lastBreedTime;
        uint32 wins;
        uint32 losses;
        uint32 racesWon;
        uint32 xp;
        bool isAlive;
        uint8 trainingLevel;
    }
    
    function getHenTraits(uint256 tokenId) external view returns (HenTraits memory);
    function ownerOf(uint256 tokenId) external view returns (address);
    function mintOffspring(
        address to,
        uint8 strength,
        uint8 speed,
        uint8 stamina,
        uint8 intelligence,
        uint8 luck,
        uint8 generation
    ) external returns (uint256);
    function addXP(uint256 tokenId, uint256 xpAmount) external;
}

contract HenBreeding is Ownable, ReentrancyGuard {
    IHenNFT public henNFT;
    
    // Breeding costs and cooldowns
    uint256 public constant BREEDING_COST = 0.01 ether;
    uint256 public constant BREEDING_COOLDOWN = 7 days;
    uint256 public constant MAX_GENERATION = 10;
    
    // Track breeding pairs to prevent inbreeding
    mapping(uint256 => mapping(uint256 => bool)) public hasBred;
    mapping(uint256 => uint256) public breedCount;
    mapping(uint256 => uint256[]) public offspring;
    
    // Events
    event BreedingInitiated(
        uint256 indexed parent1Id,
        uint256 indexed parent2Id,
        uint256 indexed offspringId,
        address breeder
    );
    event OffspringBorn(uint256 indexed tokenId, IHenNFT.HenTraits traits);
    
    constructor(address _henNFTAddress) {
        henNFT = IHenNFT(_henNFTAddress);
    }
    
    // Breed two hens
    function breedHens(uint256 parent1Id, uint256 parent2Id) 
        external 
        payable 
        nonReentrant 
        returns (uint256) 
    {
        require(msg.value >= BREEDING_COST, "Insufficient breeding fee");
        require(parent1Id != parent2Id, "Cannot breed with itself");
        require(henNFT.ownerOf(parent1Id) == msg.sender, "Not owner of parent 1");
        require(henNFT.ownerOf(parent2Id) == msg.sender, "Not owner of parent 2");
        require(!hasBred[parent1Id][parent2Id] && !hasBred[parent2Id][parent1Id], "Already bred");
        
        IHenNFT.HenTraits memory parent1 = henNFT.getHenTraits(parent1Id);
        IHenNFT.HenTraits memory parent2 = henNFT.getHenTraits(parent2Id);
        
        require(parent1.isAlive && parent2.isAlive, "Parent must be alive");
        require(
            block.timestamp >= parent1.lastBreedTime + BREEDING_COOLDOWN,
            "Parent 1 cooldown not finished"
        );
        require(
            block.timestamp >= parent2.lastBreedTime + BREEDING_COOLDOWN,
            "Parent 2 cooldown not finished"
        );
        require(
            parent1.generation < MAX_GENERATION && parent2.generation < MAX_GENERATION,
            "Max generation reached"
        );
        
        // Mark as bred
        hasBred[parent1Id][parent2Id] = true;
        hasBred[parent2Id][parent1Id] = true;
        breedCount[parent1Id]++;
        breedCount[parent2Id]++;
        
        // Generate offspring traits (simplified - use Chainlink VRF in production)
        uint256 seed = _generateOffspringId(parent1Id, parent2Id);
        IHenNFT.HenTraits memory offspringTraits = _inheritTraits(parent1, parent2, seed);

        // Mint offspring via HenNFT contract (breeding contract must be authorized in HenNFT)
        uint256 newTokenId = henNFT.mintOffspring(
            msg.sender,
            offspringTraits.strength,
            offspringTraits.speed,
            offspringTraits.stamina,
            offspringTraits.intelligence,
            offspringTraits.luck,
            offspringTraits.generation
        );

        // Award XP to both parents for breeding
        henNFT.addXP(parent1Id, 25); // XP_PER_BREED
        henNFT.addXP(parent2Id, 25); // XP_PER_BREED

        // Record offspring relationship (store the actual tokenId)
        offspring[parent1Id].push(newTokenId);
        offspring[parent2Id].push(newTokenId);

        emit BreedingInitiated(parent1Id, parent2Id, newTokenId, msg.sender);
        emit OffspringBorn(newTokenId, offspringTraits);

        return newTokenId;
    }
    
    // Calculate offspring traits based on parents
    function _inheritTraits(
        IHenNFT.HenTraits memory parent1,
        IHenNFT.HenTraits memory parent2,
        uint256 seed
    ) private view returns (IHenNFT.HenTraits memory) {
        uint8 generation = parent1.generation > parent2.generation ? 
                          parent1.generation + 1 : parent2.generation + 1;
        
        return IHenNFT.HenTraits({
            strength: _inheritAttribute(parent1.strength, parent2.strength, seed, "strength"),
            speed: _inheritAttribute(parent1.speed, parent2.speed, seed, "speed"),
            stamina: _inheritAttribute(parent1.stamina, parent2.stamina, seed, "stamina"),
            intelligence: _inheritAttribute(parent1.intelligence, parent2.intelligence, seed, "intelligence"),
            luck: _inheritAttribute(parent1.luck, parent2.luck, seed, "luck"),
            generation: generation,
            birthTime: uint48(block.timestamp),
            lastBreedTime: 0,
            wins: 0,
            losses: 0,
            racesWon: 0,
            xp: 0,
            isAlive: true,
            trainingLevel: 0
        });
    }
    
    // Inherit single attribute with genetic variation
    function _inheritAttribute(
        uint8 parent1Attr,
        uint8 parent2Attr,
        uint256 seed,
        string memory attrName
    ) private view returns (uint8) {
        uint256 random = uint256(keccak256(abi.encodePacked(
            block.timestamp,
            seed,
            attrName,
            parent1Attr,
            parent2Attr
        ))) % 100;
        
        // 40% chance from parent1, 40% from parent2, 20% mutation
        if (random < 40) {
            return _mutate(parent1Attr, seed);
        } else if (random < 80) {
            return _mutate(parent2Attr, seed);
        } else {
            // Average with mutation
            uint8 avg = uint8((uint16(parent1Attr) + uint16(parent2Attr)) / 2);
            return _mutate(avg, seed);
        }
    }
    
    // Apply random mutation (+/- 5 points)
    function _mutate(uint8 value, uint256 seed) private view returns (uint8) {
        uint256 random = uint256(keccak256(abi.encodePacked(
            block.timestamp,
            seed,
            value,
            block.prevrandao
        ))) % 11; // 0-10
        
        int16 mutation = int16(uint16(random)) - 5; // -5 to +5
        int16 newValue = int16(uint16(value)) + mutation;
        
        // Clamp between 1 and 100
        if (newValue < 1) return 1;
        if (newValue > 100) return 100;
        return uint8(uint16(newValue));
    }
    
    // Generate pseudo-unique offspring ID
    function _generateOffspringId(uint256 parent1Id, uint256 parent2Id) 
        private 
        view 
        returns (uint256) 
    {
        return uint256(keccak256(abi.encodePacked(
            block.timestamp,
            parent1Id,
            parent2Id,
            msg.sender,
            block.prevrandao
        )));
    }
    
    // Get breeding info for a hen
    function getBreedingInfo(uint256 tokenId) 
        external 
        view 
        returns (
            uint256 breedingCount,
            uint256 cooldownRemaining,
            uint256[] memory offspringIds
        ) 
    {
        IHenNFT.HenTraits memory traits = henNFT.getHenTraits(tokenId);
        uint256 cooldown = 0;
        
        if (block.timestamp < traits.lastBreedTime + BREEDING_COOLDOWN) {
            cooldown = (traits.lastBreedTime + BREEDING_COOLDOWN) - block.timestamp;
        }
        
        return (
            breedCount[tokenId],
            cooldown,
            offspring[tokenId]
        );
    }
    
    // Check if two hens can breed
    function canBreed(uint256 parent1Id, uint256 parent2Id) 
        external 
        view 
        returns (bool, string memory) 
    {
        if (parent1Id == parent2Id) {
            return (false, "Cannot breed with itself");
        }
        
        if (hasBred[parent1Id][parent2Id] || hasBred[parent2Id][parent1Id]) {
            return (false, "Already bred together");
        }
        
        IHenNFT.HenTraits memory parent1 = henNFT.getHenTraits(parent1Id);
        IHenNFT.HenTraits memory parent2 = henNFT.getHenTraits(parent2Id);
        
        if (!parent1.isAlive || !parent2.isAlive) {
            return (false, "Parent not alive");
        }
        
        if (block.timestamp < parent1.lastBreedTime + BREEDING_COOLDOWN) {
            return (false, "Parent 1 on cooldown");
        }
        
        if (block.timestamp < parent2.lastBreedTime + BREEDING_COOLDOWN) {
            return (false, "Parent 2 on cooldown");
        }
        
        if (parent1.generation >= MAX_GENERATION || parent2.generation >= MAX_GENERATION) {
            return (false, "Max generation reached");
        }
        
        return (true, "Can breed");
    }
    
    // Get offspring of a hen
    function getOffspring(uint256 parentId) external view returns (uint256[] memory) {
        return offspring[parentId];
    }
    
    // Withdraw breeding fees
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Withdrawal failed");
    }
}

contracts/HenNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract HenNFT is ERC721, ERC721URIStorage, Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // Hen attributes - Optimized struct packing (saves gas)
    struct HenTraits {
        // Slot 1 (32 bytes): All uint8 attributes packed together
        uint8 strength;     // 1-100
        uint8 speed;        // 1-100
        uint8 stamina;      // 1-100
        uint8 intelligence; // 1-100
        uint8 luck;         // 1-100
        uint8 generation;   // 0 for initial, increases with breeding
        // Slot 2: birthTime
        uint48 birthTime;   // Timestamp fits in 48 bits (until year 8921556)
        uint48 lastBreedTime;
        uint32 wins;        // Max 4.2 billion wins (more than enough)
        uint32 losses;      // Max 4.2 billion losses
        uint32 racesWon;    // Max 4.2 billion races
        uint32 xp;          // Experience points
        bool isAlive;
        uint8 trainingLevel; // 0-10, increases with training
    }
    
    // Training constants
    uint256 public constant TRAIN_PRICE = 0.005 ether; // Cost to train a hen
    uint256 public constant RENAME_PRICE = 0.001 ether; // Cost to rename a hen
    uint256 public constant MAX_TRAINING_LEVEL = 10;
    
    // XP and Leveling constants
    uint256 public constant XP_PER_BATTLE = 50;
    uint256 public constant XP_PER_BATTLE_WIN = 100;
    uint256 public constant XP_PER_RACE = 30;
    uint256 public constant XP_PER_RACE_WIN = 75;
    uint256 public constant XP_PER_BREED = 25;
    
    // Hen names (optional cosmetic feature)
    mapping(uint256 => string) public henNames;

    // Mapping from token ID to traits
    mapping(uint256 => HenTraits) public henTraits;
    // Authorized contracts
    address public breedingContract;
    address public battleContract;
    address public racingContract;
    
    // Marketplace
    struct Listing {
        uint256 price;
        address seller;
        bool isActive;
    }
    mapping(uint256 => Listing) public listings;

    // Events
    event HenMinted(uint256 indexed tokenId, address indexed owner, HenTraits traits);
    event HenListed(uint256 indexed tokenId, uint256 price, address indexed seller);
    event HenSold(uint256 indexed tokenId, address indexed from, address indexed to, uint256 price);
    event HenDelisted(uint256 indexed tokenId, address indexed seller);
    event BattleResult(uint256 indexed henId, bool won);

    // Constants
    uint256 public constant MINT_PRICE = 0.01 ether;
    uint256 public constant MARKETPLACE_FEE = 250; // 2.5% (basis points)
    uint256 public constant MAX_SUPPLY = 10000;

    constructor() ERC721("CryptoHens", "HEN") {}

    // Mint a new hen
    function mintHen() external payable nonReentrant returns (uint256) {
        require(msg.value >= MINT_PRICE, "Insufficient payment");
        require(_tokenIds.current() < MAX_SUPPLY, "Max supply reached");

        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _safeMint(msg.sender, newTokenId);

        // Generate random traits (in production, use Chainlink VRF)
        HenTraits memory traits = HenTraits({
            strength: uint8(_randomNumber(newTokenId, "strength") % 81 + 20),
            speed: uint8(_randomNumber(newTokenId, "speed") % 81 + 20),
            stamina: uint8(_randomNumber(newTokenId, "stamina") % 81 + 20),
            intelligence: uint8(_randomNumber(newTokenId, "intelligence") % 81 + 20),
            luck: uint8(_randomNumber(newTokenId, "luck") % 81 + 20),
            generation: 0,
            birthTime: uint48(block.timestamp),
            lastBreedTime: 0,
            wins: 0,
            losses: 0,
            racesWon: 0,
            xp: 0,
            isAlive: true,
            trainingLevel: 0
        });

        henTraits[newTokenId] = traits;

        emit HenMinted(newTokenId, msg.sender, traits);
        return newTokenId;
    }

    // Batch mint multiple hens (saves gas)
    function batchMintHens(uint256 quantity) external payable nonReentrant returns (uint256[] memory) {
        require(quantity > 0 && quantity <= 10, "Can mint 1-10 hens at once");
        require(msg.value >= MINT_PRICE * quantity, "Insufficient payment");
        require(_tokenIds.current() + quantity <= MAX_SUPPLY, "Would exceed max supply");

        uint256[] memory newTokenIds = new uint256[](quantity);

        for (uint256 i = 0; i < quantity; i++) {
            _tokenIds.increment();
            uint256 newTokenId = _tokenIds.current();
            
            _safeMint(msg.sender, newTokenId);

            // Generate random traits with unique seed per hen
            HenTraits memory traits = HenTraits({
                strength: uint8(_randomNumber(newTokenId, "strength") % 81 + 20),
                speed: uint8(_randomNumber(newTokenId, "speed") % 81 + 20),
                stamina: uint8(_randomNumber(newTokenId, "stamina") % 81 + 20),
                intelligence: uint8(_randomNumber(newTokenId, "intelligence") % 81 + 20),
                luck: uint8(_randomNumber(newTokenId, "luck") % 81 + 20),
                generation: 0,
                birthTime: uint48(block.timestamp),
                lastBreedTime: 0,
                wins: 0,
                losses: 0,
                racesWon: 0,
                xp: 0,
                isAlive: true,
                trainingLevel: 0
            });

            henTraits[newTokenId] = traits;
            newTokenIds[i] = newTokenId;

            emit HenMinted(newTokenId, msg.sender, traits);
        }

        return newTokenIds;
    }

    // List hen on marketplace
    function listHen(uint256 tokenId, uint256 price) external {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(price > 0, "Price must be greater than 0");
        require(!listings[tokenId].isActive, "Already listed");

        listings[tokenId] = Listing({
            price: price,
            seller: msg.sender,
            isActive: true
        });

        emit HenListed(tokenId, price, msg.sender);
    }

    // Buy hen from marketplace
    function buyHen(uint256 tokenId) external payable nonReentrant {
        Listing memory listing = listings[tokenId];
        require(listing.isActive, "Not listed for sale");
        require(msg.value >= listing.price, "Insufficient payment");

        address seller = listing.seller;
        uint256 price = listing.price;

        // Calculate marketplace fee
        uint256 fee = (price * MARKETPLACE_FEE) / 10000;
        uint256 sellerAmount = price - fee;

        // Clear listing
        delete listings[tokenId];

        // Transfer NFT
        _transfer(seller, msg.sender, tokenId);

        // Transfer funds
        (bool successSeller, ) = payable(seller).call{value: sellerAmount}("");
        require(successSeller, "Transfer to seller failed");

        emit HenSold(tokenId, seller, msg.sender, price);

        // Refund excess payment
        if (msg.value > price) {
            (bool successRefund, ) = payable(msg.sender).call{value: msg.value - price}("");
            require(successRefund, "Refund failed");
        }
    }

    // Delist hen from marketplace
    function delistHen(uint256 tokenId) external {
        require(listings[tokenId].seller == msg.sender, "Not the seller");
        require(listings[tokenId].isActive, "Not listed");

        delete listings[tokenId];
        emit HenDelisted(tokenId, msg.sender);
    }

    // Train hen to boost stats (Token Sink)
    function trainHen(uint256 tokenId) external payable nonReentrant {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(msg.value >= TRAIN_PRICE, "Insufficient payment for training");
        require(henTraits[tokenId].trainingLevel < MAX_TRAINING_LEVEL, "Max training level reached");

        // Increase training level
        henTraits[tokenId].trainingLevel++;
        
        // Boost random stat by 1-3 points (max 100)
        uint256 rand = _randomNumber(tokenId, "train");
        uint256 statToBoost = rand % 5; // 0-4 for the 5 stats
        uint256 boost = (rand % 3) + 1; // 1-3 boost
        
        if (statToBoost == 0 && henTraits[tokenId].strength < 100) {
            henTraits[tokenId].strength = uint8(_min(100, uint256(henTraits[tokenId].strength) + boost));
        } else if (statToBoost == 1 && henTraits[tokenId].speed < 100) {
            henTraits[tokenId].speed = uint8(_min(100, uint256(henTraits[tokenId].speed) + boost));
        } else if (statToBoost == 2 && henTraits[tokenId].stamina < 100) {
            henTraits[tokenId].stamina = uint8(_min(100, uint256(henTraits[tokenId].stamina) + boost));
        } else if (statToBoost == 3 && henTraits[tokenId].intelligence < 100) {
            henTraits[tokenId].intelligence = uint8(_min(100, uint256(henTraits[tokenId].intelligence) + boost));
        } else if (statToBoost == 4 && henTraits[tokenId].luck < 100) {
            henTraits[tokenId].luck = uint8(_min(100, uint256(henTraits[tokenId].luck) + boost));
        }
        
        emit HenTrained(tokenId, henTraits[tokenId].trainingLevel);
    }
    
    // Rename hen (Cosmetic Token Sink)
    function renameHen(uint256 tokenId, string memory newName) external payable {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        require(msg.value >= RENAME_PRICE, "Insufficient payment for renaming");
        require(bytes(newName).length > 0 && bytes(newName).length <= 32, "Invalid name length");
        
        henNames[tokenId] = newName;
        emit HenRenamed(tokenId, newName);
    }
    
    // Helper function
    function _min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
    
    // Events for new features
    event HenTrained(uint256 indexed tokenId, uint8 trainingLevel);
    event HenRenamed(uint256 indexed tokenId, string newName);

    // Update battle stats (only callable by battle contract)
    function updateBattleStats(uint256 tokenId, bool won) external {
        require(msg.sender == battleContract || msg.sender == owner(), "Not authorized");
        if (won) {
            henTraits[tokenId].wins++;
        } else {
            henTraits[tokenId].losses++;
        }
        emit BattleResult(tokenId, won);
    }

    // Update race stats
    function updateRaceStats(uint256 tokenId) external {
        require(msg.sender == racingContract || msg.sender == owner(), "Not authorized");
        henTraits[tokenId].racesWon++;
    }

    // Add XP and handle level-ups
    function addXP(uint256 tokenId, uint256 xpAmount) external {
        require(msg.sender == battleContract || msg.sender == racingContract || msg.sender == breedingContract || msg.sender == owner(), "Not authorized");
        require(_exists(tokenId), "Token does not exist");
        
        HenTraits storage hen = henTraits[tokenId];
        uint32 oldLevel = _calculateLevel(hen.xp);
        
        // Add XP (cap at uint32 max)
        uint256 newXP = uint256(hen.xp) + xpAmount;
        hen.xp = newXP > type(uint32).max ? type(uint32).max : uint32(newXP);
        
        uint32 newLevel = _calculateLevel(hen.xp);
        
        // Award stat bonuses for level-ups
        if (newLevel > oldLevel) {
            uint32 levelsGained = newLevel - oldLevel;
            // +1 to 2 random stats per level
            for (uint32 i = 0; i < levelsGained; i++) {
                _awardLevelUpBonus(tokenId, hen);
            }
        }
    }
    
    // Calculate level from XP (level = floor(sqrt(xp/100)))
    function _calculateLevel(uint32 xp) private pure returns (uint32) {
        if (xp == 0) return 1;
        uint256 level = _sqrt(uint256(xp) / 100);
        return level == 0 ? 1 : uint32(level);
    }
    
    // Award random stat bonuses on level-up
    function _awardLevelUpBonus(uint256 tokenId, HenTraits storage hen) private {
        uint256 rand = uint256(keccak256(abi.encodePacked(block.timestamp, tokenId, hen.xp)));
        uint8 stat1 = uint8(rand % 5);
        uint8 stat2 = uint8((rand / 5) % 5);
        
        // Increase 1-2 random stats by 1 (cap at 100)
        if (stat1 == 0 && hen.strength < 100) hen.strength++;
        else if (stat1 == 1 && hen.speed < 100) hen.speed++;
        else if (stat1 == 2 && hen.stamina < 100) hen.stamina++;
        else if (stat1 == 3 && hen.intelligence < 100) hen.intelligence++;
        else if (stat1 == 4 && hen.luck < 100) hen.luck++;
        
        if (stat2 != stat1) {
            if (stat2 == 0 && hen.strength < 100) hen.strength++;
            else if (stat2 == 1 && hen.speed < 100) hen.speed++;
            else if (stat2 == 2 && hen.stamina < 100) hen.stamina++;
            else if (stat2 == 3 && hen.intelligence < 100) hen.intelligence++;
            else if (stat2 == 4 && hen.luck < 100) hen.luck++;
        }
    }
    
    // Square root helper (Babylonian method)
    function _sqrt(uint256 x) private pure returns (uint256) {
        if (x == 0) return 0;
        uint256 z = (x + 1) / 2;
        uint256 y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
        return y;
    }

    // Set authorized contract addresses
    function setBreedingContract(address _addr) external onlyOwner {
        breedingContract = _addr;
    }

    function setBattleContract(address _addr) external onlyOwner {
        battleContract = _addr;
    }

    function setRacingContract(address _addr) external onlyOwner {
        racingContract = _addr;
    }

    // Mint an offspring with precomputed traits - callable only by breeding contract
    function mintOffspring(
        address to,
        uint8 strength,
        uint8 speed,
        uint8 stamina,
        uint8 intelligence,
        uint8 luck,
        uint8 generation
    ) external nonReentrant returns (uint256) {
        require(msg.sender == breedingContract, "Only breeding contract can mint offspring");
        require(_tokenIds.current() < MAX_SUPPLY, "Max supply reached");

        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _safeMint(to, newTokenId);

        HenTraits memory traits = HenTraits({
            strength: strength,
            speed: speed,
            stamina: stamina,
            intelligence: intelligence,
            luck: luck,
            generation: generation,
            birthTime: uint48(block.timestamp),
            lastBreedTime: 0,
            wins: 0,
            losses: 0,
            racesWon: 0,
            xp: 0,
            isAlive: true,
            trainingLevel: 0
        });

        henTraits[newTokenId] = traits;

        emit HenMinted(newTokenId, to, traits);
        return newTokenId;
    }

    // Get hen traits
    function getHenTraits(uint256 tokenId) external view returns (HenTraits memory) {
        require(_exists(tokenId), "Token does not exist");
        return henTraits[tokenId];
    }

    // Get hen power rating
    function getHenPower(uint256 tokenId) public view returns (uint256) {
        HenTraits memory traits = henTraits[tokenId];
        return uint256(traits.strength) + 
               uint256(traits.speed) + 
               uint256(traits.stamina) + 
               uint256(traits.intelligence) + 
               uint256(traits.luck);
    }

    // Get all hens owned by address
    function getHensByOwner(address owner) external view returns (uint256[] memory) {
        uint256 balance = balanceOf(owner);
        uint256[] memory ownedHens = new uint256[](balance);
        uint256 counter = 0;

        for (uint256 i = 1; i <= _tokenIds.current(); i++) {
            if (_exists(i) && ownerOf(i) == owner) {
                ownedHens[counter] = i;
                counter++;
            }
        }

        return ownedHens;
    }

    // Withdraw contract balance
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Withdrawal failed");
    }

    // Internal random number generator (use Chainlink VRF in production)
    function _randomNumber(uint256 tokenId, string memory attribute) private view returns (uint256) {
        return uint256(keccak256(abi.encodePacked(
            block.timestamp,
            block.prevrandao,
            tokenId,
            attribute,
            msg.sender
        )));
    }

    // Override required functions
    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    // Solidity multiple inheritance requires overriding _burn when using ERC721URIStorage
    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

contracts/HenRacing.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface IHenNFT {
    struct HenTraits {
        uint8 strength;
        uint8 speed;
        uint8 stamina;
        uint8 intelligence;
        uint8 luck;
        uint8 generation;
        uint48 birthTime;
        uint48 lastBreedTime;
        uint32 wins;
        uint32 losses;
        uint32 racesWon;
        uint32 xp;
        bool isAlive;
        uint8 trainingLevel;
    }
    
    function getHenTraits(uint256 tokenId) external view returns (HenTraits memory);
    function ownerOf(uint256 tokenId) external view returns (address);
    function updateRaceStats(uint256 tokenId) external;
    function addXP(uint256 tokenId, uint256 xpAmount) external;
}

contract HenRacing is Ownable, ReentrancyGuard {
    IHenNFT public henNFT;
    
    // Race structure
    struct Race {
        uint256 raceId;
        uint256 startTime;
        uint256 endTime;
        uint256 entryFee;
        uint256 prizePool;
        uint256 maxParticipants;
        uint256[] participants;
        uint256[] finalPositions;
        bool isActive;
        bool isComplete;
        mapping(uint256 => uint256) henToPosition;
    }
    
    // Race results
    struct RaceResult {
        uint256 raceId;
        uint256 henId;
        address owner;
        uint256 position;
        uint256 finishTime;
        uint256 prize;
    }
    
    mapping(uint256 => Race) public races;
    mapping(uint256 => RaceResult[]) public raceResults;
    mapping(uint256 => mapping(uint256 => bool)) public henInRace;
    mapping(uint256 => uint256) public henActiveRace; // Tracks which race a hen is currently in (0 = none)
    uint256 public raceCounter;
    uint256 public activeRacesCount;
    uint256 public constant MAX_ACTIVE_RACES = 2;
    uint256 public constant RACE_DURATION = 30; // 30 seconds
    
    // Prize distribution (1st: 50%, 2nd: 30%, 3rd: 20%)
    uint256[3] public prizeDistribution = [50, 30, 20];
    
    // Events
    event RaceCreated(
        uint256 indexed raceId,
        uint256 startTime,
        uint256 entryFee,
        uint256 maxParticipants
    );
    event HenEntered(
        uint256 indexed raceId,
        uint256 indexed henId,
        address indexed owner
    );
    event RaceStarted(uint256 indexed raceId, uint256[] participants);
    event RaceComplete(
        uint256 indexed raceId,
        uint256[] winners,
        uint256[] prizes
    );
    event PrizeAwarded(
        uint256 indexed raceId,
        uint256 indexed henId,
        address indexed owner,
        uint256 position,
        uint256 prize
    );
    
    constructor(address _henNFTAddress) {
        henNFT = IHenNFT(_henNFTAddress);
    }
    
    // Create a new race (anyone can create)
    function createRace(
        uint256 entryFee,
        uint256 maxParticipants
    ) external returns (uint256) {
        require(activeRacesCount < MAX_ACTIVE_RACES, "Maximum active races reached");
        require(entryFee >= 0.001 ether && entryFee <= 1 ether, "Entry fee must be 0.001-1 ETH");
        require(maxParticipants >= 5 && maxParticipants <= 20, "Participant count must be 5-20");
        
        raceCounter++;
        activeRacesCount++;
        Race storage newRace = races[raceCounter];
        newRace.raceId = raceCounter;
        newRace.startTime = 0; // Will be set when race starts
        newRace.entryFee = entryFee;
        newRace.maxParticipants = maxParticipants;
        newRace.isActive = true;
        newRace.isComplete = false;
        
        emit RaceCreated(raceCounter, block.timestamp, entryFee, maxParticipants);
        return raceCounter;
    }
    
    // Enter a hen in a race
    function enterRace(uint256 raceId, uint256 henId) 
        external 
        payable 
        nonReentrant 
    {
        Race storage race = races[raceId];
        
        require(race.isActive, "Race not active");
        require(!race.isComplete, "Race already complete");
        require(race.startTime == 0 || block.timestamp < race.startTime, "Race already started");
        require(henNFT.ownerOf(henId) == msg.sender, "Not owner of hen");
        require(!henInRace[raceId][henId], "Hen already entered");
        require(henActiveRace[henId] == 0, "Hen already in an active race");
        require(race.participants.length < race.maxParticipants, "Race full");
        require(msg.value >= race.entryFee, "Insufficient entry fee");
        
        IHenNFT.HenTraits memory traits = henNFT.getHenTraits(henId);
        require(traits.isAlive, "Hen must be alive");
        
        race.participants.push(henId);
        race.prizePool += race.entryFee;
        henInRace[raceId][henId] = true;
        henActiveRace[henId] = raceId;
        
        emit HenEntered(raceId, henId, msg.sender);
        
        // Refund excess payment
        if (msg.value > race.entryFee) {
            (bool success, ) = payable(msg.sender).call{value: msg.value - race.entryFee}("");
            require(success, "Refund failed");
        }
    }
    
    // Manually start a race
    function startRace(uint256 raceId) external {
        Race storage race = races[raceId];
        require(race.isActive, "Race not active");
        require(race.startTime == 0 || race.startTime > 0, "Invalid race");
        require(race.participants.length >= 5, "Minimum 5 participants required");
        require(!race.isComplete, "Race already complete");
        
        race.startTime = block.timestamp;
        
        emit RaceStarted(raceId, race.participants);
    }
    
    // Complete a race after 30 seconds
    function completeRace(uint256 raceId) external {
        Race storage race = races[raceId];
        require(race.startTime > 0, "Race not started");
        require(!race.isComplete, "Race already complete");
        require(block.timestamp >= race.startTime + RACE_DURATION, "Race still in progress");
        
        _simulateRace(raceId);
        
        // Auto-create a new race with same settings if under limit
        if (activeRacesCount < MAX_ACTIVE_RACES) {
            raceCounter++;
            activeRacesCount++;
            Race storage newRace = races[raceCounter];
            newRace.raceId = raceCounter;
            newRace.startTime = 0;
            newRace.entryFee = race.entryFee;
            newRace.maxParticipants = race.maxParticipants;
            newRace.isActive = true;
            newRace.isComplete = false;
            
            emit RaceCreated(raceCounter, block.timestamp, race.entryFee, race.maxParticipants);
        }
    }
    
    // Simulate race based on hen attributes
    function _simulateRace(uint256 raceId) private {
        Race storage race = races[raceId];
        uint256[] memory participants = race.participants;
        uint256[] memory finishTimes = new uint256[](participants.length);
        
        // Calculate finish time for each hen
        for (uint256 i = 0; i < participants.length; i++) {
            uint256 henId = participants[i];
            IHenNFT.HenTraits memory traits = henNFT.getHenTraits(henId);
            
            // Base time inversely proportional to speed
            uint256 baseTime = 10000 - (uint256(traits.speed) * 50);
            
            // Stamina affects consistency
            uint256 staminaFactor = (uint256(traits.stamina) * 10);
            
            // Luck affects race outcome
            uint256 luckBonus = uint256(keccak256(abi.encodePacked(
                block.timestamp,
                henId,
                i,
                block.prevrandao
            ))) % uint256(traits.luck);
            
            finishTimes[i] = baseTime - staminaFactor - luckBonus;
        }
        
        // Sort participants by finish time
        _sortByFinishTime(participants, finishTimes);
        
        // Assign positions and distribute prizes
        _distributeRacePrizes(raceId, participants);
        
        race.finalPositions = participants;
        race.isComplete = true;
        race.endTime = block.timestamp;
        activeRacesCount--;
        
        // Clear hen active race tracking
        for (uint256 i = 0; i < participants.length; i++) {
            henActiveRace[participants[i]] = 0;
        }
    }
    
    // Sort hens by finish time (bubble sort for simplicity)
    function _sortByFinishTime(
        uint256[] memory participants,
        uint256[] memory finishTimes
    ) private pure {
        uint256 n = participants.length;
        for (uint256 i = 0; i < n - 1; i++) {
            for (uint256 j = 0; j < n - i - 1; j++) {
                if (finishTimes[j] > finishTimes[j + 1]) {
                    // Swap finish times
                    (finishTimes[j], finishTimes[j + 1]) = (finishTimes[j + 1], finishTimes[j]);
                    // Swap participants
                    (participants[j], participants[j + 1]) = (participants[j + 1], participants[j]);
                }
            }
        }
    }
    
    // Distribute prizes to winners
    function _distributeRacePrizes(uint256 raceId, uint256[] memory sortedParticipants) private {
        Race storage race = races[raceId];
        uint256 prizePool = race.prizePool;
        
        uint256[] memory winners = new uint256[](3);
        uint256[] memory prizes = new uint256[](3);
        
        // Distribute to top 3
        uint256 winnersCount = sortedParticipants.length < 3 ? sortedParticipants.length : 3;
        
        for (uint256 i = 0; i < winnersCount; i++) {
            uint256 henId = sortedParticipants[i];
            uint256 prize = (prizePool * prizeDistribution[i]) / 100;
            address owner = henNFT.ownerOf(henId);
            
            winners[i] = henId;
            prizes[i] = prize;
            
            // Update race stats and award XP
            if (i == 0) {
                henNFT.updateRaceStats(henId);
                henNFT.addXP(henId, 105); // XP_PER_RACE (30) + XP_PER_RACE_WIN (75)
            } else {
                henNFT.addXP(henId, 30); // XP_PER_RACE only (participation)
            }
            
            // Store result
            raceResults[raceId].push(RaceResult({
                raceId: raceId,
                henId: henId,
                owner: owner,
                position: i + 1,
                finishTime: block.timestamp,
                prize: prize
            }));
            
            race.henToPosition[henId] = i + 1;
            
            // Transfer prize
            (bool success, ) = payable(owner).call{value: prize}("");
            require(success, "Prize transfer failed");
            
            emit PrizeAwarded(raceId, henId, owner, i + 1, prize);
        }
        
        emit RaceComplete(raceId, winners, prizes);
    }
    
    // Get race details
    function getRaceParticipants(uint256 raceId) 
        external 
        view 
        returns (uint256[] memory) 
    {
        return races[raceId].participants;
    }
    
    // Get race results
    function getRaceResults(uint256 raceId) 
        external 
        view 
        returns (RaceResult[] memory) 
    {
        return raceResults[raceId];
    }
    
    // Get hen's race statistics
    function getHenRaceStats(uint256 henId) 
        external 
        view 
        returns (
            uint256 totalRaces,
            uint256 wins,
            uint256 totalPrizes
        ) 
    {
        IHenNFT.HenTraits memory traits = henNFT.getHenTraits(henId);
        wins = traits.racesWon;
        
        // Count total races participated
        uint256 raceCount = 0;
        uint256 totalEarned = 0;
        
        for (uint256 i = 1; i <= raceCounter; i++) {
            if (henInRace[i][henId]) {
                raceCount++;
                
                // Sum prizes
                RaceResult[] memory results = raceResults[i];
                for (uint256 j = 0; j < results.length; j++) {
                    if (results[j].henId == henId) {
                        totalEarned += results[j].prize;
                    }
                }
            }
        }
        
        return (raceCount, wins, totalEarned);
    }
    
    // Check if hen can enter race
    function canEnterRace(uint256 raceId, uint256 henId) 
        external 
        view 
        returns (bool, string memory) 
    {
        Race storage race = races[raceId];
        
        if (!race.isActive) {
            return (false, "Race not active");
        }
        
        if (race.isComplete) {
            return (false, "Race already complete");
        }
        
        if (race.startTime > 0 && block.timestamp >= race.startTime) {
            return (false, "Race already started");
        }
        
        if (henInRace[raceId][henId]) {
            return (false, "Hen already entered");
        }
        
        if (henActiveRace[henId] != 0) {
            return (false, "Hen in active race");
        }
        
        if (race.participants.length >= race.maxParticipants) {
            return (false, "Race full");
        }
        
        IHenNFT.HenTraits memory traits = henNFT.getHenTraits(henId);
        if (!traits.isAlive) {
            return (false, "Hen not alive");
        }
        
        return (true, "Can enter");
    }
    
    // Cancel race (only if not enough participants)
    function cancelRace(uint256 raceId) external onlyOwner {
        Race storage race = races[raceId];
        require(!race.isComplete, "Race already complete");
        require(race.startTime == 0, "Race already started");
        require(race.participants.length < 5, "Too many participants to cancel");
        
        // Refund participants and clear tracking
        for (uint256 i = 0; i < race.participants.length; i++) {
            uint256 henId = race.participants[i];
            address owner = henNFT.ownerOf(henId);
            henActiveRace[henId] = 0;
            
            (bool success, ) = payable(owner).call{value: race.entryFee}("");
            require(success, "Refund failed");
        }
        
        race.isActive = false;
        if (activeRacesCount > 0) {
            activeRacesCount--;
        }
    }
}

